import { useMemo, useState } from "react"
import { Form } from "react-bootstrap"
import Select from 'react-select'
import countryList from 'react-select-country-list'
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

const SecondPage = () => {
    const [startDate, setStartDate] = useState(new Date());
    return (
        <div className="secondpage-container">
            <div>Passport details</div>
            <div>Enter the following details as they appear in the applicant's personal passport.</div>
            <div className='parent'>
                <label className="title">Family name</label>
                <span className="inputform"><input className='form-control col-6'></input></span>
            </div>
            <div className='parent'>
                <label className="title">Given names</label>
                <span className="inputform"><input className='form-control col-6'></input></span>
            </div>
            <div className='Sexform'>
                <div class="form-check-label" >
                    <div className="check-radio">Sex:</div>
                    <Form className="check-radio-answer">
                        {['radio'].map((type) => (
                            <div key={`default-${type}`} className="mb-3">
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Female"}

                                />
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Female"}
                                />
                                <Form.Check
                                    type={type}
                                    id={`question1-${type}`}
                                    label={"Other"}
                                />
                            </div>
                        ))}
                    </Form>
                </div>
            </div>
            <div className="DatePicker">
                <div className="Current-location">Date of birth</div>
                <div className="child-date" ><DatePicker selected={startDate} onChange={(date) => setStartDate(date)} />  </div>
            </div>
             
        </div>
    )
}

export default SecondPage;
